    com.datical.liquibase.ext.storedlogic.function.Function:
    - function:
        body: "CREATE OR REPLACE FUNCTION get_total_sales(\n    in_year PLS_INTEGER\n\
          ) \nRETURN NUMBER\nIS\n    l_total_sales NUMBER := 0;\nBEGIN\n    -- get\
          \ total sales\n    SELECT SUM(unit_price * quantity)\n    INTO l_total_sales\n\
          \    FROM order_items\n    INNER JOIN orders USING (order_id)\n    WHERE\
          \ status = 'Shipped'\n    GROUP BY EXTRACT(YEAR FROM order_date)\n    HAVING\
          \ EXTRACT(YEAR FROM order_date) = in_year;\n\n    -- return the total sales\n\
          \    RETURN l_total_sales;\nEND;"
        name: GET_TOTAL_SALES
        schema: liquibase.structure.core.Schema#4e62101
        snapshotId: '4e62242'
        valid: true
    com.datical.liquibase.ext.storedlogic.trigger.Trigger:
    - trigger:
        actionType: 'PL/SQL     '
        baseObjectType: TABLE
        body: "CREATE OR REPLACE TRIGGER customers_audit_trg\n    AFTER \n    UPDATE\
          \ OR DELETE \n    ON customers\n    FOR EACH ROW    \nDECLARE\n   l_transaction\
          \ VARCHAR2(10);\nBEGIN\n   -- determine the transaction type\n   l_transaction\
          \ := CASE  \n         WHEN UPDATING THEN 'UPDATE'\n         WHEN DELETING\
          \ THEN 'DELETE'\n   END;\n\n   -- insert a row into the audit table   \n\
          \   INSERT INTO audits (table_name, transaction_name, by_user, transaction_date)\n\
          \   VALUES('CUSTOMERS', l_transaction, USER, SYSDATE);\nEND;"
        disabled: false
        name: CUSTOMERS_AUDIT_TRG
        referencingNames: REFERENCING NEW AS NEW OLD AS OLD
        schema: liquibase.structure.core.Schema#4e62101
        snapshotId: '4e62102'
