    liquibase.structure.core.StoredProcedure:
    - storedProcedure:
        body: "CREATE OR REPLACE PROCEDURE print_contact(in_customer_id NUMBER)\n\
          IS r_contact contacts%ROWTYPE;\n\nBEGIN\n\n  SELECT *\n  INTO r_contact\n\
          \  FROM contacts\n  WHERE customer_id = in_customer_id;\n  \n  dbms_output.put_line(\
          \ r_contact.first_name || ' ' ||\n  r_contact.last_name || '<' || r_contact.email\
          \ ||'>' );\n\nEXCEPTION\n   WHEN OTHERS THEN\n      dbms_output.put_line(\
          \ SQLERRM );\nEND;"
        name: PRINT_CONTACT
