    liquibase.structure.core.View:
    - view:
        columns:
        - liquibase.structure.core.Column#4e62237
        - liquibase.structure.core.Column#4e62238
        - liquibase.structure.core.Column#4e62239
        definition: |-
          SELECT
              name AS customer,
              SUM( quantity * unit_price ) sales_amount,
              EXTRACT(
                  YEAR
              FROM
                  order_date
              ) YEAR
          FROM
              orders
          INNER JOIN order_items
                  USING(order_id)
          INNER JOIN customers
                  USING(customer_id)
          WHERE
              status = 'Shipped'
          GROUP BY
              name,
              EXTRACT(
                  YEAR
              FROM
                  order_date
              )
        editioning: false
        name: CUSTOMER_SALES
        schema: liquibase.structure.core.Schema#4e62101
